tinymce.PluginManager.requireLangPack("mc_pages");tinymce.PluginManager.add("mc_pages",(function(editor,url){editor.ui.registry.addIcon("page",'<svg width="24" height="24"><use xlink:href="/'+baseadmin+'/template/img/tinymce/mc_icons.svg#page"></use></svg>');function showDialog(){editor.windowManager.openUrl({title:"mc_pages Title",url:tinyMCE.baseURL+"/plugins/mc_pages/pages.php",width:800,height:550,inline:1,resizable:true,maximizable:true})}editor.ui.registry.addButton("mc_pages",{icon:"page",tooltip:"mc_pages Title",onAction:()=>{_api=showDialog()},onSetup:buttonApi=>{const editorEventCallback=eventApi=>buttonApi.setEnabled(eventApi.element.nodeName!=="IMG");editor.on("NodeChange",editorEventCallback);return buttonApi=>editor.off("NodeChange",editorEventCallback)}})}));